column10:
De G120 frequentieregelaar is leverbaar vanaf 0,75-250 kW en geschikt voor voedingsspanningen van 400VAC.

De regelaar is specifiek ontworpen voor dynamische toepassing in de industrie zonder regeneratief bedrijf.

&nbsp;

De Vacon 20 frequentieregelaar is leverbaar vanaf 0,25-2,2 kW en geschikt voor voedingsspanningen van 1 fase 230VAC.

De regelaar is specifiek ontworpen voor algemene inzet bij OEM'ers zoals machinebouwers

&nbsp;

De Vacon 100 FLOW frequentieregelaar met SBF4 thermistorkaart is leverbaar vanaf 1,1-315 kW in IP21 uitvoering. Eenvoudige integratie in de fabrieksautomatisering met ingebouwde Modbus RTU (RS485) of Modbus TCP (Ethernet). Integratie via Profinet IO of Ethernet IP systemen door software opties.

De regelaar is specifiek ontworpen ter verbetering van de debietregeling in applicaties voor water, afvalwater en gebouwautomatisering.

&nbsp;

&nbsp;

De Vacon 20x frequentieregelaar is leverbaar vanaf 0,75-7,5 kW. De IP 66 regelaar wordt ingezet indien een hogere IP klasse dan IP 54 is vereist voor b.v. buitenopstelling. Leverbaar met diverse opties waaronder hoofdschakelaar.

De regelaar is ontworpen voor algemene toepassing.

&nbsp;

De Vacon 100x frequentieregelaar is leverbaar vanaf 1,1-37 kW. De IP 66 regelaar wordt ingezet indien een hogere IP klasse dan IP 54 is vereist voor b.v. buitenopstelling. Leverbaar met diverse opties waaronder hoofdschakelaar.

De regelaar is ontworpen voor algemene toepassing.

&nbsp;

De BAPI EZP verschildruk opnemer beschikt over 10 in het veld selecteerbare meetbereiken. De EPZ is ontworpen om te monteren op DIN-rail, in Snap Track of op een oppervlak te worden geschroefd. Drie uitgangsbereiken van 0 tot 5 VDC, 0 tot 10 VDC en 4 tot 20 mA zijn ook in het veld selecteerbaar voor alle drukbereiken. Het aansluitklemmenblok van de bedrading is stekkerbaar.

&nbsp;

&nbsp;

&nbsp;

